import React from "react";
import { Card } from "antd";
import Avatar from "antd/lib/avatar/avatar";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          짹짹
          <br />0
        </div>,
        <div key="followings">
          팔로잉
          <br />0
        </div>,
        <div key>
          팔로워
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>MG</Avatar>} title="mingyu" />
      <Button>로그아웃</Button>
    </Card>
  );
};

export default UserProfile;
